function OpenCloakroomMenu()

  local elements = {}
  
        if PlayerData.job and PlayerData.job.name == 'unicorn' then
           table.insert(elements, {label = ('Go Off Duty'), value = 'OffDuty'})
        end
	  
	    if PlayerData.job and PlayerData.job.name == 'offunicorn' then
	       table.insert(elements, {label = ('Go On Duty'),  value = 'OnDuty'})
      end

      table.insert(elements, {label = ('Change Clothing'), value = 'player_dressing'})
      table.insert(elements, {label = ('Delete Clothing'), value = 'remove_cloth'})

	  	  	 	 	 	  
  ESX.UI.Menu.CloseAll()

    ESX.UI.Menu.Open(
      'default', GetCurrentResourceName(), 'cloakroom',
      {
        title    = _U('cloakroom'),
        align    = 'bottom-right',
		css      = 'Inventaire',
        elements = elements,
        },
        function(data, menu)
		
	local mugshot, mugshotStr = ESX.Game.GetPedMugshot(PlayerPedId())	

		if data.current.value == 'player_dressing' then 
      ESX.TriggerServerCallback('esx_unicornjob:getPlayerDressing', function(dressing)
				local elements = {}

				for i=1, #dressing, 1 do
					table.insert(elements, {
						label = dressing[i],
						value = i
					})
				end
				ESX.UI.Menu.Open('default', GetCurrentResourceName(), 'player_dressing', {
					title    = "Outfits",
					align    = 'bottom-right',
	                css      = 'apps',
					elements = elements
				}, function(data2, menu2)
					TriggerEvent('skinchanger:getSkin', function(skin)
						ESX.TriggerServerCallback('esx_unicornjob:getPlayerOutfit', function(clothes)
							TriggerEvent('skinchanger:loadClothes', skin, clothes)
							TriggerEvent('esx_skin:setLastSkin', skin)

							TriggerEvent('skinchanger:getSkin', function(skin)
								TriggerServerEvent('esx_skin:save', skin)
							end)
						end, data2.current.value)
					end)
				end, function(data2, menu2)
					menu2.close()
				end)
			end)
    end

		if data.current.value == 'remove_cloth' then
			ESX.TriggerServerCallback('esx_unicornjob:getPlayerDressing', function(dressing)
				local elements = {}

				for i=1, #dressing, 1 do
					table.insert(elements, {
						label = dressing[i],
						value = i
					})
				end
				ESX.UI.Menu.Open('default', GetCurrentResourceName(), 'remove_cloth', {
					title    = "Remove Outfit",
					align    = 'bottom-right',
	                css      = 'apps',
					elements = elements
				}, function(data2, menu2)
					menu2.close()
					TriggerServerEvent('esx_unicornjob:removeOutfit', data2.current.value)
					ESX.ShowNotification(('You Just Threw Out Those Clothes'))
				end, function(data2, menu2)
					menu2.close()
				end)
			end)
		end
	  
	if data.current.value == 'OnDuty' then
		  
	    ESX.TriggerServerCallback('esx_service:enableService', function(canTakeService, maxInService, inServiceCount) 
	    if canTakeService then 		   
		   ESX.ShowAdvancedNotification('Vanilla Unicorn', '', 'You Are Now ~g~[On Duty]', mugshotStr, 1)
           TriggerServerEvent("duty:unicorn")
           TriggerServerEvent('UnicornDutyLog', 'On')
		   menu.close()
	  else
           ESX.ShowNotification('~r~Max ~w~Players On Duty Reached - ~g~' .. inServiceCount .. '~w~/~y~' .. maxInService)
        end 
      end, 'unicorn')
      
    end
	  	  		 		  
	if data.current.value == 'OffDuty' then
        TriggerServerEvent('esx_service:disableService', 'unicorn')
        TriggerServerEvent("duty:unicorn2")
        TriggerServerEvent('UnicornDutyLog', 'Off')
		ESX.ShowAdvancedNotification('Vanilla Unicorn', '', 'You Are Now ~r~[Off Duty]', mugshotStr, 1)
        menu.close()		
     end
	  	 	 				  	        		  
      CurrentAction     = 'menu_cloakroom'
      CurrentActionMsg  = _U('open_cloackroom')
      CurrentActionData = {}
    end,
    function(data, menu)
      menu.close()
      CurrentAction     = 'menu_cloakroom'
      CurrentActionMsg  = _U('open_cloackroom')
      CurrentActionData = {}
    end
    )
end

function OpenSocietyActionsMenu()

  local elements = {}

  table.insert(elements, {label = _U('billing'),    value = 'billing'})
  
  if PlayerData.job and PlayerData.job.grade == 0 or PlayerData.job and PlayerData.job.grade == 3 or PlayerData.job and PlayerData.job.grade == 4 then
     table.insert(elements, {label = _U('danceranims'),  value = 'danceranims'})
  end
  
  ESX.UI.Menu.CloseAll()
  ESX.UI.Menu.Open(
    'default', GetCurrentResourceName(), 'unicorn_actions',
    {
      title    = _U('unicorn'),
      align    = 'bottom-right',
	  css      = 'Inventaire',
      elements = elements
    },
    function(data, menu)

      if data.current.value == 'billing' then
        OpenBillingMenu()
      end
	  
	  if data.current.value == 'danceranims' then
        OpenAnimationsMenuunicorn()
      end    
    end,
    function(data, menu)

      menu.close()

    end
  )
end

function OpenAnimationsMenuunicorn()

	local elements = {}

	for i=1, #Config.Animations, 1 do
		table.insert(elements, {label = Config.Animations[i].label, value = Config.Animations[i].name})
	end


	ESX.UI.Menu.Open(
		'default', GetCurrentResourceName(), 'animations',
		{
			title    = 'Animations',
			align    = 'bottom-right',
			css      = 'Inventaire',
			elements = elements
		},
		function(data, menu)
			OpenAnimationsSubMenudancers(data.current.value)
		end,
		function(data, menu)
			menu.close()
		end
	)
end

function OpenAnimationsSubMenudancers(menu)

	local title    = nil
	local elements = {}

	for i=1, #Config.Animations, 1 do
		
		if Config.Animations[i].name == menu then

			title = Config.Animations[i].label

			for j=1, # Config.Animations[i].items, 1 do
				table.insert(elements, {label = Config.Animations[i].items[j].label, type = Config.Animations[i].items[j].type, value = Config.Animations[i].items[j].data})
			end

			break
		end
	end

	ESX.UI.Menu.Open(
		'default', GetCurrentResourceName(), 'animations_sub',
		{
			title    = title,
			align    = 'bottom-right',
			css      = 'Inventaire',
			elements = elements
		},
		function(data, menu)

			local type = data.current.type
			local lib  = data.current.value.lib
			local anim = data.current.value.anim

			if type == 'scenario' then
				startScenario(anim)
			else
				if type == 'attitude' then
					startAttitude(lib, anim)
				else
					startAnim(lib, anim)
				end
			end

		end,
		function(data, menu)
			menu.close()
		end
	 )
end

function startAttitude(lib, anim)
 	Citizen.CreateThread(function()
	
	    local playerPed = GetPlayerPed(-1)
	
	    RequestAnimSet(anim)
	      
	    while not HasAnimSetLoaded(anim) do
	        Citizen.Wait(0)
	    end
	    SetPedMovementClipset(playerPed, anim, true)
	end)
end

function startAnim(lib, anim)
 	
	Citizen.CreateThread(function()
	  RequestAnimDict(lib)  
	  while not HasAnimDictLoaded( lib) do
	    Citizen.Wait(0)
	  end
	  TaskPlayAnim(GetPlayerPed(-1), lib ,anim ,8.0, -8.0, -1, 0, 0, false, false, false )
	end)
end

function startScenario(anim)
  TaskStartScenarioInPlace(GetPlayerPed(-1), anim, 0, false)
end

function OpenBillingMenu()

  ESX.UI.Menu.Open(
    'dialog', GetCurrentResourceName(), 'billing',
    {
      title = _U('billing_amount')
    },
    function(data, menu)
    
      local amount = tonumber(data.value)
      local player, distance = ESX.Game.GetClosestPlayer()

      if player ~= -1 and distance <= 3.0 then

        menu.close()
        if amount == nil then
            ESX.ShowNotification(_U('amount_invalid'))
        else
            TriggerServerEvent('qi2yr-473kd-ldk3d-jf73s-3ls3s', GetPlayerServerId(player), 'society_unicorn', _U('billing'), amount)
        end

      else
        ESX.ShowNotification(_U('no_players_nearby'))
      end
    end,
    function(data, menu)
        menu.close()
    end
  )
end

function OpenShopMenu(zone)

    local elements = {}
    for i=1, #Config.Zones[zone].Items, 1 do

        local item = Config.Zones[zone].Items[i]

        table.insert(elements, {
            label     = item.label .. ' - <span style="color:red;">$' .. item.price .. ' </span>',
            realLabel = item.label,
            value     = item.name,
            price     = item.price
         })
    end

    ESX.UI.Menu.CloseAll()

    ESX.UI.Menu.Open(
        'default', GetCurrentResourceName(), 'unicorn_shop',
        {
            title    = _U('shop'),
            elements = elements
        },
        function(data, menu)
            TriggerServerEvent('esx_unicornjob:buyItem', data.current.value, data.current.price, data.current.realLabel)
        end,
        function(data, menu)
            menu.close()
        end
    )
end

