Citizen.CreateThread(function()
    while true do

        Wait(5)
        if PlayerData.job and PlayerData.job.name == 'unicorn' or PlayerData.job and PlayerData.job.name == 'offunicorn' then

            local coords      = GetEntityCoords(GetPlayerPed(-1))
            local isInMarker  = false
            local currentZone = nil

            for k,v in pairs(Config.Zones) do
                if(GetDistanceBetweenCoords(coords, v.Pos.x, v.Pos.y, v.Pos.z, true) < 0.5) then
                    isInMarker  = true
                    currentZone = k
                end
            end
			
			for k,v in pairs(Config.BossMarkers) do
                if(GetDistanceBetweenCoords(coords, v.Pos.x, v.Pos.y, v.Pos.z, true) < 0.5) then
                    isInMarker  = true
                    currentZone = k
                end
            end

            if (isInMarker and not HasAlreadyEnteredMarker) or (isInMarker and LastZone ~= currentZone) then
                HasAlreadyEnteredMarker = true
                LastZone                = currentZone
                TriggerEvent('esx_unicornjob:hasEnteredMarker', currentZone)
            end

            if not isInMarker and HasAlreadyEnteredMarker then
                HasAlreadyEnteredMarker = false
                TriggerEvent('esx_unicornjob:hasExitedMarker', LastZone)
            end
        end
    end
end)


