       SetTextComponentFormat('STRING')
       AddTextComponentString(CurrentActionMsg)
       DisplayHelpTextFromStringLabel(0, 0, 1, -1)

      if IsControlJustReleased(0, Keys['E']) then
	  
	   if PlayerData.job and PlayerData.job.name == 'unicorn' or PlayerData.job and PlayerData.job.name == 'offunicorn' then
	   
        if CurrentAction == 'menu_cloakroom' then
            OpenCloakroomMenu()
        end
          
        if CurrentAction == 'menu_boss_actions' and PlayerData.job and PlayerData.job.grade_name == 'boss' then

          ESX.UI.Menu.CloseAll()
          TriggerEvent('c3733e85-777a-8285-4836-20b26c07edbc', 'unicorn', function(data, menu)--esx_society:openBossMenu

            menu.close()
            CurrentAction     = 'menu_boss_actions'
            CurrentActionMsg  = _U('open_bossmenu')
            CurrentActionData = {}
          end)
        end 
      end		
         CurrentAction = nil
      end	 
    end

    if IsControlJustReleased(0,  Keys['F6']) and PlayerData.job and PlayerData.job.name == 'unicorn' and not ESX.UI.Menu.IsOpen('default', GetCurrentResourceName(), 'unicorn_actions') then
        OpenSocietyActionsMenu()
    end
  end
end)